(36, 'Giải thể thao Sinh viên Việt Nam', 'Giải thể thao sinh viên Việt Nam – VUG là giải thể thao thường niên do Trung ương Hội Sinh viên Việt Nam, Trung tâm Hỗ trợ và Phát triển sinh viên Việt Nam tổ chức với các môn bóng đá trong nhà, nhảy đối kháng.\r\nChính thức bắt đầu từ năm 2013, Giải Thể thao sinh viên Việt Nam đã nhanh chóng trở thành một trong những sân chơi thể thao lớn thường niên, uy tín và hấp dẫn trong cộng đồng sinh viên trên cả nước. Giải đấu đã góp phần thiết thực tạo môi trường cho sinh viên rèn luyện “thể lực tốt”, phấn đấu trở thành “Sinh viên 5 tốt”. Không chỉ là thể thao, VUG còn là nơi để sinh viên thể hiện sức sáng tạo, bản sắc và lòng tự hào đối với ngôi trường mình đang theo học.', 1000000, 11, 'Đang diễn ra', '/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEB\nAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQH/2wBDAQEBAQEBAQEBAQEBAQEBAQEBAQEB\nAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQH/wAARCAC3ARMDASIA\nAhEBAxEB/8QAHwAAAgIDAQADAQAAAAAAAAAACAkGBwAFCgQBAgsD/8QAZxAAAQEEBQYJBwcGCAkG\nDwAABQYBBxEVABYhJTECAwg1QVEEFyZFVWFxgfAJEjZlkaGxRlaFwdHh8RMiJ2Z1dhQYIzdClaW1\nJDJigoa2xdXlCihHUpamMzREU1RXY2R3g5KXosb1/8QAHgEAAgMAAwEBAQAAAAAAAAAABQcEBggA\nAQMCCQr/xABIEQABAgQDBQYDBAgCCAcAAAABAhEEBSExAEFRBhIUYXEDFSKBkaEHsdEyweHwExYk\nQlJicvElwggjJjRTVYKiFzVDRJWyw//aAAwDAQACEQMRAD8AiWkVoXPMcaNSvHkmWXQGuiT88f1K\nxnd7Owb1Ln6zDRXJkTdCwT8oDyaQcn+hfZH6qdIGmlwFcvydLWYmMm4p3Wt2dS0Yy+9/JiHd1YUQ\netkATrJLBhMsrBQgPOrn1EHZhuwj12dtEjCg/wDsARk7DRvz9cLrbvZiN2ZnfAwLsCHvQBtHDDJr\nNnlbaDSpNTEyq5ll6tuWp9m3odljfbHupaKJzCG4yJYhnZ1sVXO7FhzPBm3Dqx6qC7o3rGWJuZky\nZYsVa3U8n/tq2ztja3HdS9TC4YhpUuRhMuJVRf1Pt6tnV8WUifpI0RwgFEPcpJAJFHDOGzHXFf4Y\nxgYguL9TUl2p0xsgKHXPH8VJywqWK88Bw/M6f8fCxrIUv57SqUwzkyTm0qZbu1197PhSEurf9UYl\nWYne03ZEvOeeGw8Y0hLyFUTUw1fvM1TW4xJZz0P0FDZ727dlI6ZVBxs6EeP8DIZ2/eIb2IHm5fAO\nJheDNGd/J3Hk/wA/bBVaN79+KBEqkmTQ7vnrzYRJm1whPEhZlMg2LGthFsfzWsa1rMYNbktiaV0k\n9HpTO3Kpkm7ISrHqF6wSgPgerAFNz8HXCdfIX5O8mvkjvtoHKD0Qnv8AFuqnwfJUQZve+LTDPU+6\nyG77